    " ggplot(count_hourly) +\n",
    "      geom_col(aes(date_time, steptotal), fill = \"#4169e1\") +\n",
    "      labs(title = \"Steps taken by hour of the day\", x= \"Hourly Time\", y = \"Steps\") +\n",
    "      geom_hline(yintercept = 480)"
   ]
