   "source": [
    "Bellabeat is a health-tech company that focuses their development of products for their female userbase. For the future, it would be much more beneficial if Bellabeat asks for consent from their users to track their own userbase in order to analyze more closely related data. That way, the data analysts can make more involved analyses and they can make recommendations that apply more closely to Bellabeat's users. \n",
    "\n",
    "But working with the dataset we were given, the target market for Bellabeat looks like it is the average hard working women with careers or full-time jobs. This assumption is made because of the patterns seen in the data, where the Steps Taken by Hour of Day chart shows us that most of the activity happens during most working hours (6:00 A.M. to 11:00 P.M.). \n",
    "\n",
    "With that being said, we know what hours of the day we can send notifications to our users. These notifications will help our users be reminded of the goal they need to hit so that they can achieve a healthy, active lifestyle. Action points include (but not limited to):\n",
    "\n",
    "\n",
    "\n"
   ]
  },
  {
   "cell_type": "markdown",
   "id": "6c7a1aa9",
   "metadata": {
    "papermill": {
     "duration": 0.068844,
     "end_time": "2022-09-11T00:04:58.709655",
     "exception": false,
     "start_time": "2022-09-11T00:04:58.640811",
     "status": "completed"
    },
    "tags": []
   },
   "source": [
    "| Action Point | Description |\n",
    "| ------- | ------- |\n",
    "| **1.) Rewards system** | If Bellabeat is going to ask for consent to obtain their user's data, there needs to be an incentive so that users feel more enticed to participate. One way to do this is to introduce a **rewards system to users that opt-in for data gathering.** Bellabeat can develop this by having their users **earn Bellapoints by achieving fitness goals and having a rewards store** available that has **Bellabeat gift cards, and women's health and fitness related items.** This way, we can hit two birds with one stone by **having consenting users provide us more accurate data for future analyses and also encouraging them to hit their goals consistently in order to purchase from the rewards store.** |\n",
    "| **2.) Notification reminders during active hours** | Since we know what time users are active, we can send notifications to Bellabeat users during the active hours of 6:00 A.M. to 11:00 P.M. One example can be a **goal reminder notification sent near the end of the working hours, which is 5:00 PM to 6:00 PM, where the app reminds the user how close they are to the goal of 10,000 steps a day.** Another example is a **sleep reminder notification around the hours of 9:00 PM to 10:00 PM, where the users can be reminded to sleep soon so that they can get their full 480 minutes of sleep in.**|\n",
    "| **3.) Calorie watch** | Since we know our users are concerned about keeping track of the fitness metrics, we can safely assume that they also care about their daily caloric intake to maintain a healthy weight. Since our scatter plot indicated a positive relationship between steps taken and calories, we can send **alerts to our users during lunch and dinner hours about keeping track of their calories** so that their daily steps help provide more of an impact to their weight management. Bellabeat can **remind their users about their daily calorie goals**, depending on the capabilities and features of the app. Also, **during the morning or 3 to 4 hours before lunch or dinner hours, the app can also send recipe ideas of healthy meals to the users** to help aid the daily struggle of having to think of what to cook. These recipes can **include the total calorie count and nutrients, like protein,** contained in the meal.|"
